import Home from "./pages/Home";
import MyRing from './pages/MyRing';

function App() {
  return (
    <Router>
      <div>
        <div>
          <Link to="/"></Link>
        </div>
        <div>
          <Link to="/ring"></Link>
        </div>
      </div>
      <Routes>
        <Route path="/" element={<Home/>}>
        </Route>
        <Route path="/ring" element={<MyRing/>}>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
